import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './guestbook.css';

function fileToBase64(file, callback) {
  const reader = new FileReader();
  reader.onload = function (e) {
    // The result attribute of FileReader contains the base64 string
    callback(e.target.result);
  };
  reader.onerror = function (error) {
    console.log('Error: ', error);
  };
  reader.readAsDataURL(file);
}

function Guestbook() {
  const [posts, setPosts] = useState([])
  const [filename, setFilename] = useState('');
  const [file, setFile] = useState(null)
  const [subject, setSubject] = useState('')
  const [content, setContent] = useState('')

  useEffect(() => {
    window.scrollTo(0, 0)
    window.scrollTo = function () {};
  }, [])


  useEffect(() => {
    fetch('https://motluc-nammex.tlon.network/moo')
    .then(response => {
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      return response.json();
    })
    .then(data => {
      console.log(data.content.split('ILOVEJOANBEAZ').filter((e: string) => e.includes('subject')));
    })
    .catch(error => {
      console.error('There has been a problem with your fetch operation:', error);
    });
  }, []);

  return (
    <div id="chan" style={{overflow: "scroll" }}>
      <header style={{display: 'flex', flexDirection: 'column', alignItems: 'center'}}>
        <h1 id="title">33chan</h1>
        <p style={{width: '400px', textAlign: 'center'}}><i>an anonymous imageboard</i></p>
        <form onSubmit={async e=>{
            // upload to backend...
            // Try to upload. If it fails or something's wrong, show an error and call e.preventDefault();
            if (subject === '') {
              alert('Subject field cannot be empty!')
            }
            if (content === '') {
              alert('Your post is empty!')
            }
            if (file === null) {
              alert('You must attach a file!')
            }
            console.log(subject)
            console.log(content)
            console.log(file)
            const url = 'https://motluc-nammex.tlon.network/moo';
            const data = {
                subject,
                content,
            };
            console.log(JSON.stringify(data))
            fetch(url, {
                method: 'POST',
                headers: {
                  'Accept': 'application/json',
                  'Content-Type': 'application/json'
                },
                body: '{"ok": 3}'
            })
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                console.log('Success:', data);
            })
            .catch((error) => {
                console.error('Error:', error);
            });
            }} style={{maxWidth: "fit-content"}}>
          <input name='subject' onChange={e=>setSubject(e.target.value)} value={subject} placeholder='Subject...' type="text"></input><br />
          <textarea name='content' onChange={e=>setContent(e.target.value)} value={content} placeholder='Say hi!' rows={3} cols={25}></textarea><br />
          <input name='file' style={{width: '230px'}} onChange={e=>{setFilename(e.target.value);fileToBase64(e.target.files[0], setFile)}} value={filename} type='file'></input><br />
          <input type='submit'></input>
        </form>
      </header>
      <hr />
      <img id="image" src={(file !== null) ? file : ''} alt="Image preview"></img>
      {posts.map(p => (
  <div className="post-container">
    <div className="post-image-container">
      IMAGE GOES HERE
    </div>
    <div className="post-text">
      <font color='maroon'><b>Subject: </b></font>
      <span className='post-subject'>SUBJECT HERE</span><br />
      <span>CONTENT HERE</span>
    </div>
  </div>
))}

    </div>
  );
}

export default Guestbook;
